// src/components/About.js
import React from 'react';

const About = () => {
  return (
    <section id="about">
      <h2 className="magictime puffIn">About Me</h2>
      <p style={{ fontSize: '1.1rem', maxWidth: '700px' }}>
        I am from South Central Pennsysvania and have experience 
      </p>
      <p style={{ marginTop: '1rem', fontSize: '1.1rem', maxWidth: '700px' }}>
        Currently based in London, I thrive on solving real-world problems and learning new 
        technologies. Outside of coding, I enjoy reading about product strategy, exploring local 
        coffee shops, and building side projects for fun.
      </p>
    </section>
  );
};

export default About;
